    private static int getLcm(int n) {
        int lcm =1;
        for(int i=n; i>0; i--){
            if(lcm%i==0) continue;
            lcm = calc(lcm, i);
        }
        return lcm;
    }

    private static int calc(int i, int j) {
        int h = hcf(i, j);
        int n1 = i/h;
        int n2 = j/h;

        return h*n1*n2;
    }

    private static int hcf(int i, int j) {
        System.out.println("This is i:" + i + "and this is j: "+ j);
        if(i%j==0) return j;

        return hcf(j, i%j);
    }

    private static int getMissingElement(int[] arr, int n) {
        int sum=0;
        for(int e : arr){
            sum +=e;
        }
        int exp = (n*(n+1))/2;

        return exp - sum;
    }

